// src/index.js
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Login from './Login'; // Asegúrate de que el componente Login esté exportado desde el archivo Login.js

ReactDOM.render(
  <React.StrictMode>
    <Login />
  </React.StrictMode>,
  document.getElementById('root')
);
